import React from 'react';
import './Skills.css'; // Assurez-vous de créer ce fichier CSS pour le style

const skills = [
    {
      id: 1,
      title: 'Email Client Prototype',
      lang: ['js.png', 'html-css.jpg'],
      subtitle: 'HTML CSS JAVASCRIPT ',
      text: 'This is a project',
      image: 'project1.png',
      link: '/projet1' // Lien vers les détails du projet
    },
    {
      id: 2,
      title: 'Terminal Enigma Machine',
      lang: ['java.png'],
      subtitle: 'Description du Projet 2',
      text: 'This is a project',
      image: 'project2.png',
      link: '/projet2'
    },
    {
      id: 3,
      title: 'Resume Website',
      lang: ['react.png'],
      subtitle: 'Description du Projet 2',
      text: 'This is a project',
      image: 'project3.png',
      link: '/projet2'
    }]

function Skills() {
  return (
    <div className="skills-container">
      {skills.map(skill => (
        <div key={skill.id} className="skill-thumbnail">
          <div className="thumbnail-image">
            <img src={skill.image} alt={skill.title} />
          </div>
          <div className="skill-details">
            <h1>{skill.title}</h1>
            <div className="lang-images">
              {skill.lang.map((image, index) => (
                <img key={index} src={image} alt={`Vignette ${index}`} className='lang' />
              ))}
            </div>
            <p>{skill.text}</p>
            <a href={skill.link} className="skill-link">GitHub</a>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Skills;
